import Skill from "./Skill";

import classes from "./SkillList.module.css"

const skills=[
  {name: "HTML" ,imgUrl: ""},
  {name: "CSS" ,imgUrl: ""},
  {name: "Javscript" ,imgUrl: ""},
  {name: "Bootstrap" ,imgUrl: ""},
  {name: "ReactJs" ,imgUrl: ""},
  {name: "Javscript" ,imgUrl: ""}
]

const SkillList = () => {

  return <div className={classes["skill-grid"]}>
    <Skill skillArr={skills}/>
  </div>

};

export default SkillList;
